(18000, 1237, 'короткое_описание', 'ЖК «25 Жемчужина» новый комплекс, который расположится на Итальянском бульваре. Воздвигаться комплекс будет по всем стандартам и нормам строительства. Комплексы «24-ая и 25-ая Жемчужина»- это совместный дуэт, который дополняет друг друга своей изысканностью и красотой архитектуры.'),
(18001, 1237, '_короткое_описание', 'field_5a78b4b9e5d81'),
(18002, 1237, 'описание', 'ЖК «25 Жемчужина» новый комплекс, который расположится на Итальянском бульваре. Воздвигаться комплекс будет по всем стандартам и нормам строительства. Комплексы «24-ая и 25-ая Жемчужина»- это совместный дуэт, который дополняет друг друга своей изысканностью и красотой архитектуры. Прекрасное расположение, жильцы этого комплекса будут наслаждаться прогулками по парку Шевченко, а также баловать себя посещениями в Академический театр Музыкальной комедии, который располагается в нескольких минутах ходьбы от комплекса.'),
