(18065, 1238, 'короткое_описание', 'Девятиэтажный жилой дом со встроенными офисными помещениями и паркингом по ул. Осипова, 40 расположен в Приморском районе г. Одесса в зоне существующей застройки на пересечении улиц Осипова и Большая Арнаутская. Заезд в паркинг осуществляется с ул. Осипова'),
(18066, 1238, '_короткое_описание', 'field_5a78b4b9e5d81'),
(18067, 1238, 'описание', 'Девятиэтажный жилой дом со встроенными офисными помещениями и паркингом по ул. Осипова, 40 расположен в Приморском районе г. Одесса в зоне существующей застройки на пересечении улиц Осипова и Большая Арнаутская. Заезд в паркинг осуществляется с ул. Осипова. Вход в помещения общественного назначения с ул. Большая Арнаутская. Здания жилого комплекса запроектированы с учетом современных требований и современного передового опыта в решении архитектурно — пространственного облика и надежности здания, с учетом требований ДБН В.1.1-12:2006 «Будівництво в сейсмічних районах». Здание запроектировано на сейсмическую нагрузку 8 баллов.\r\nКонструктивная схема здания – безригельный железобетонный каркас с диафрагмами и ядрами жесткости. Пространственная жесткость каркаса здания обеспечивается диафрагмами и ядрами и жесткими узлами сопряжения колонн и перекрытий.'),
