(18205, 1242, 'галерея_дома', '<img class="alignnone size-full wp-image-1291" src="http://novostroy/wp-content/uploads/2018/02/24.jpg" alt="" width="2480" height="1753" /><img class="alignnone size-full wp-image-1292" src="http://novostroy/wp-content/uploads/2018/02/.jpg" alt="" width="2480" height="1753" />'),
