(18273, 1243, 'короткое_описание', 'ЖК«Родос» — новый проект компании «Гефест» на Генуэзской,1. В проект заложен 24-этажный дом, это сочетание эстетики и качества, а также правильное место для достойной жизни: 5 минут пешком до Аркадии и парка Победы, лучшие магазины, рестораны, спортивные и танцевальные клубы практически за углом, отличная транспортная развязка.'),
