(18333, 1244, 'галерея_дома', '<img class="alignnone size-full wp-image-1297" src="http://novostroy/wp-content/uploads/2018/02/cam_06.jpg" alt="" width="1667" height="2000" /> <img class="alignnone size-medium wp-image-1298" src="http://novostroy/wp-content/uploads/2018/02/210.jpg" alt="" width="1667" height="2000" /> <img class="alignnone size-medium wp-image-1299" src="http://novostroy/wp-content/uploads/2018/02/37.jpg" alt="" width="1667" height="2000" /> <img class="alignnone size-medium wp-image-1300" src="http://novostroy/wp-content/uploads/2018/02/cam_05.jpg" alt="" width="1499" height="1756" />'),
