(18337, 1244, 'короткое_описание', '«26 Жемчужина» на Генуэзской — новый, 24-х этажный проект компании «KADORR Group». Это курортный район Одессы, расположенный в непосредственной близости к морю, с прекрасным сообщением со всеми районами города, включая центр. '),
(18338, 1244, '_короткое_описание', 'field_5a78b4b9e5d81'),
(18339, 1244, 'описание', '«26 Жемчужина» на Генуэзской — новый, 24-х этажный проект компании «KADORR Group». Это курортный район Одессы, расположенный в непосредственной близости к морю, с прекрасным сообщением со всеми районами города, включая центр. Комплекс будет возведен с учетом всех норм и последних достижений в области строительства и архитектуры. В жилом комплексе Двадцать Шестая Жемчужина будет паркинг, ухоженная придомовая территория, служба охраны и эксплуатации, места для семейного отдыха.'),
