(18465, 1248, 'короткое_описание', 'ЖК «ЛИМНОС», который будет возведен в одном из красивейших уголков Одессы в Приморском районе на 6,5 станции Большого Фонтана. В недалеком будущем одесситы и гости нашего города смогут  окунуться в атмосферу изящества и комфорта, качества и надежности с новым жилым комплексом «ЛИМНОС» от компании «ГЕФЕСТ». '),
(18466, 1248, '_короткое_описание', 'field_5a78b4b9e5d81'),
(18467, 1248, 'описание', 'ЖК «ЛИМНОС», который будет возведен в одном из красивейших уголков Одессы в Приморском районе на 6,5 станции Большого Фонтана. В недалеком будущем одесситы и гости нашего города смогут  окунуться в атмосферу изящества и комфорта, качества и надежности с новым жилым комплексом «ЛИМНОС» от компании «ГЕФЕСТ». Уникальная атмосфера греческого острова будет воссоздана в Одессе в роскошном жилом комплексе на ул.Педагогической,23. Проектом предусматривается строительство 24-х этажного жилого комплекса, состоящего из двух зеркально расположенных независимых секций, которые будут включать:\r\n<ul>\r\n 	<li>подвальный этаж — подземный паркинг для хранения автомобилей для жильцов и гостей жилого комплекса на 95 автомашин.</li>\r\n 	<li>1 этаж — помещения общественного назначения: домоуправление, офисные помещения, помещения для работы с детьми. Высота этажа 3.35м;</li>\r\n 	<li>2-24 этажи -жилые квартиры.</li>\r\n</ul>'),
