(18529, 1249, 'короткое_описание', 'ЖК «Вернисаж»- расположен внутри квартала на улице Костанди, между улицей Ак. Королева и улицей Ильфа и Петрова. В непосредственной близости от комплекса расположены: больницы, аптеки, банки, продуктовые магазины, фитнес-центры, школы, автобусные остановки. '),
(18530, 1249, '_короткое_описание', 'field_5a78b4b9e5d81'),
(18531, 1249, 'описание', 'ЖК «Вернисаж»- расположен внутри квартала на улице Костанди, между улицей Ак. Королева и улицей Ильфа и Петрова. В непосредственной близости от комплекса расположены: больницы, аптеки, банки, продуктовые магазины, фитнес-центры, школы, автобусные остановки. Непосредственно на территории комплекса находится новый детский сад, построенный в соответствии со всеми современными требованиями, с полным комплектом новой мебели и оборудования, с большой благоустроенной площадкой для игр и отдыха. В рамках квартала с комплексом соседствуют две школы и два детских сада. В трех минутах ходьбы от комплекса находится сквер им. Королева, где созданы все условия для прогулок и игр с детьми.'),
