(18717, 1252, 'галерея_дома', '<img class="alignnone size-full wp-image-1325" src="http://novostroy/wp-content/uploads/2018/02/apelsin-all-plans-section-1-floor-2.jpg" alt="" width="575" height="835" /> <img class="alignnone size-medium wp-image-1326" src="http://novostroy/wp-content/uploads/2018/02/apelsin-all-plans-section-1-floor-4.jpg" alt="" width="577" height="835" /> <img class="alignnone size-medium wp-image-1327" src="http://novostroy/wp-content/uploads/2018/02/apelsin-all-plans-section-2-floor-2.jpg" alt="" width="835" height="534" /> <img class="alignnone size-medium wp-image-1328" src="http://novostroy/wp-content/uploads/2018/02/apelsin-all-plans-section-2-floor-4.jpg" alt="" width="835" height="536" /> <img class="alignnone size-medium wp-image-1329" src="http://novostroy/wp-content/uploads/2018/02/apelsin-all-plans-section-3-floor-2.jpg" alt="" width="850" height="672" /> <img class="alignnone size-medium wp-image-1330" src="http://novostroy/wp-content/uploads/2018/02/apelsin-all-plans-section-3-floor-4.jpg" alt="" width="850" height="672" /> <img class="alignnone size-medium wp-image-1331" src="http://novostroy/wp-content/uploads/2018/02/Vizualizacii-Zhiloj-kompleks-Apelsin-6.jpg" alt="" width="1600" height="1131" /> <img class="alignnone size-medium wp-image-1332" src="http://novostroy/wp-content/uploads/2018/02/Vizualizacii-Zhiloj-kompleks-Apelsin-9.jpg" alt="" width="1600" height="1131" /> <img class="alignnone size-medium wp-image-1333" src="http://novostroy/wp-content/uploads/2018/02/Vizualizacii-Zhiloj-kompleks-Apelsin-5.jpg" alt="" width="1600" height="1131" /> <img class="alignnone size-medium wp-image-1334" src="http://novostroy/wp-content/uploads/2018/02/Vizualizacii-Zhiloj-kompleks-Apelsin-3.jpg" alt="" width="1600" height="1131" /> <img class="alignnone size-medium wp-image-1335" src="http://novostroy/wp-content/uploads/2018/02/IMG_20160715_092155.jpg" alt="" width="1248" height="1664" /> <img class="alignnone size-medium wp-image-1336" sr