(18719, 1252, 'дом_на_карте', ''),
(18720, 1252, '_дом_на_карте', 'field_5a8dd29437cba'),
(18721, 1252, 'короткое_описание', 'лекса запроектированы с учетом современных требований и современного передового опыта в решении архитектурно – пространственного облика и надежности здания. Исходя из этажности жилого комплекса, была принята следующая схема – монолитный железобетонный каркас с внутренними несущими стенами.При проектировании комплекса учтены требования ДБН В.1.1-12:2006 «Будівництво в сейсмічних районах», в результате здания легко выдержат нормативную сейсмическую нагрузку, равную 7 баллам.'),
