(18723, 1252, 'описание', '<strong>Конструктивная характеристика ЖК «Апельсин»</strong>\r\n\r\nЗдания жилого комплекса запроектированы с учетом современных требований и современного передового опыта в решении архитектурно – пространственного облика и надежности здания. Исходя из этажности жилого комплекса, была принята следующая схема – монолитный железобетонный каркас с внутренними несущими стенами.При проектировании комплекса учтены требования ДБН В.1.1-12:2006 «Будівництво в сейсмічних районах», в результате здания легко выдержат нормативную сейсмическую нагрузку, равную 7 баллам.\r\n\r\n<strong>Фундаменты</strong>.  Фундаменты свайные с монолитным железобетонным ростверком.\r\n\r\n<strong>Наружные стены</strong>\r\n\r\n<strong>Цоколь</strong>, 1 этаж – пенобетон, толщина 300мм; выше 2-го этажа – утепленные трехслойные фасадные системы. Фасадные системы выполнены из стеклофибробетонных панелей с заполнением утеплителем.\r\n\r\nСтеклофибробетон – это высокотехнологичный, экологически чистый и безопасный материал, который соответствует требованиям украинских и мировых стандартов по теплотехническим, механическим и пожаробезопасным свойствам, не содержит вредные компоненты и относится к категории несгорающих материалов.\r\n\r\n<strong>Внутренние несущие стены</strong> – из монолитного железобетона, толщиной 200мм и 400мм.\r\n\r\n<strong>Перегородки между квартирами</strong> выполнены из газобетонных блоков толщиной 200мм.\r\n\r\n<strong>Кровля</strong> – рулонная плоская.\r\n\r\n<strong>Лифты</strong>. Здания оборудуются скоростными бесшумными лифтами нового поколения фирмы OTIS. Предусматривается установка в каждой секции 3-х лифтов, грузоподъемностью 630кг, 630кг и 1000кг.\r\n\r\n<strong>Окна, балконные двери</strong>. Профиль пятикамерный с монтажной шириной 70мм, с двухконтурным запиранием.  Для заполнения используется однокамерный энергосберегающий стеклопакет.\r\n\r\n<strong>Отделка мест общего пользования</strong>:\r\n<ul>\r\n 	<li>полы – декоративное покрытие;</li>\r\n 	<li>стены – окрашены;</li>\r\n 	<li>потолки – подвесные «Армстронг».</li>\r\n</ul>\r\nПри проектировании комплекса были обеспечены ряд шумозащитных мероприятий включающих в себя: — установку вентиляторов на виброизолирующих основаниях; — установку оборудования автономного теплоснабжения (котельных) на шумо- и виброизолирующей системе «плавающий пол»;\r\n\r\nОтличительной особенностью комплекса является устройство стяжки из политермбетона с наполнителем из пенополистирольных шариков, стяжка выполняет сразу две функции: шумопоглощающую и теплосберегающую.\r\n\r\n<strong>Отопление и вентиляция</strong>\r\n\r\n<strong> </strong> Источником теплоснабжения служат индивидуальные крышные газовые котельные ведущих европейских производителей. Теплоносителем для нужд отопления и теплоснабжения принята вода с параметрами 80-60°С. Система отопления – закрытая с насосной циркуляцией, двухтрубная, поквартирная, с установкой поэтажной распределительной гребенки в общем коридоре, из пластиковых труб. В качестве нагревательных приборов в квартирах устанавливаются стальные панельные радиаторы. Вытяжная вентиляция жилых комнат квартир предусмотрена через вытяжные каналы кухонь, санузлов, ванных комнат.\r\n\r\n<strong>Водоснабжение и канализация</strong>\r\n\r\nВнутренний водопровод монтируется из шитого полиэтилена. На вводе в каждую квартиру устанавливается водомер. Хозяйственно-бытовая канализация здания выполняется из полипропиленовых труб. Для обеспечения бесперебойного водоснабжения жилого комплекса запроектированы водопроводные насосные станции.\r\n\r\n<strong>Автоматизация</strong>\r\n\r\nПри проектировании жилого комплекса были обеспечены следующие системы автоматизации:\r\n<ul>\r\n 	<li>автоматика против дымной защиты, предусматривающая управление работой вентиляционных систем, обеспечивающих принудительное удаление дыма и создание подпора воздуха в лифтовые шахты,</li>\r\n 	<li>а также сигнализацию о пожаре;</li>\r\n 	<li>автоматическое управление работой вентиляционных систем, обеспечивающих удаление дыма и создание подпора воздуха в тамбур-шлюзы паркинга.</li>\r\n</ul>\r\n<strong>Электроснабжение</strong>\r\n\r\nЭлектрические сети выполняются медными проводами. Поквартирный учет электроэнергии осуществляется электронными счетчиками электроэнергии, устанавливаются в общем холле. Предусматривается резервное электроснабжение: два независимых электрических ввода от разных трансформаторов.\r\n\r\n<strong>Противопожарные мероприятия</strong>\r\n\r\nВ соответствии с требованиями норм по пожарной безопасности зданий комплекс обеспечивается организационно-техническими мероприятиями, исключающими воздействие на людей опасных факторов пожара. При строительстве зданий применяются современные строительные и отделочные материалы, конструкции и инженерные системы, обеспечивающие противопожарную защиту зданий.\r\nЖилой комплекс оборудуется средствами противопожарной защиты:\r\n<ul>\r\n 	<li>устройство эвакуационного освещения;</li>\r\n 	<li>регламентация огнестойкости конструкций;</li>\r\n 	<li>система дым удаления лифтовых шахт.</li>\r\n</ul>\r\n<input type="button" value="Вернуться" />'),
