(18781, 1253, 'галерея_дома', '<img class="alignnone size-full wp-image-1337" src="http://novostroy/wp-content/uploads/2018/02/plan-1024x515.jpg" alt="" width="1024" height="515" /> <img class="alignnone size-medium wp-image-1338" src="http://novostroy/wp-content/uploads/2018/02/final-3-2.jpg" alt="" width="3840" height="2160" /> <img class="alignnone size-medium wp-image-1339" src="http://novostroy/wp-content/uploads/2018/02/006.jpg" alt="" width="1622" height="1450" /> <img class="alignnone size-medium wp-image-1340" src="http://novostroy/wp-content/uploads/2018/02/005.jpg" alt="" width="2398" height="1450" /> <img class="alignnone size-medium wp-image-1341" src="http://novostroy/wp-content/uploads/2018/02/004.jpg" alt="" width="2500" height="1450" /> <img class="alignnone size-medium wp-image-1342" src="http://novostroy/wp-content/uploads/2018/02/003.jpg" alt="" width="2500" height="1450" /> <img class="alignnone size-medium wp-image-1343" src="http://novostroy/wp-content/uploads/2018/02/002.jpg" alt="" width="2500" height="1450" /> <img class="alignnone size-medium wp-image-1344" src="http://novostroy/wp-content/uploads/2018/02/001.jpg" alt="" width="1700" height="1450" />'),
