(18785, 1253, 'короткое_описание', 'Благоустройство\r\nПроектом предусмотрены подъезды к комплексу со стороны пер. Курортного и ул. Генуэзская.\r\nНа территории предусматриваются зоны отдыха и детские площадки.'),
(18786, 1253, '_короткое_описание', 'field_5a78b4b9e5d81'),
(18787, 1253, 'описание', '<strong>Благоустройство</strong>\r\nПроектом предусмотрены подъезды к комплексу со стороны пер. Курортного и ул. Генуэзская.\r\nНа территории предусматриваются зоны отдыха и детские площадки.\r\n<strong> Конструктивная характеристика комплекса</strong>\r\nЖилой комплекс запроектирован с учетом современных требований и передового опыта в решении архитектурно — пространственного облика и надежности здания.\r\nКонструктивная схема здания — железобетонный монолитный каркас с учетом технических требований к строительству в сейсмических зонах.\r\n<strong>Фундамент</strong>\r\nФундамент – железобетонный монолитный на свайном основании.\r\n<strong>Наружные стены</strong>\r\nНаружные стены выполнены из газобетона, толщиной 300мм с утеплением минераловатными плитами.\r\n<strong>Кровля</strong> – рулонная плоская.\r\n<strong>Фасад</strong>\r\nДекоративная штукатурка.\r\n<strong>Лифты</strong>\r\nЗдание оборудуется скоростными бесшумными лифтами нового поколения фирмы «Otis». В каждой секции предусматривается установка 3х лифтов, один грузопассажирский и два пассажирских.\r\n<strong>Окна, балконные двери</strong>\r\nПрофиль – пятикамерный ламинированный металлопластиковый.  Двухкамерные энергосберегающие стеклопакеты фирмы «Glaströsch» (Швейцария) c применением экологически чистых герметиков без содержания ртути. Фурнитура «Roto» с противовзломной функцией производство Германия.\r\n<strong>Входные двери</strong>\r\nВходные двери в квартиры – бронированные, утепленные, звукоизолированные.\r\n<strong>Холлы входных групп </strong>\r\n— в холлах размещается ресепшн\r\n— стены: декоративная штукатурка\r\n— полы: облицовка мрамором\r\n— потолок: натяжной\r\n<strong>Отделка мест общего пользования</strong>\r\n— полы:  керамическая плитка\r\n— стены: декоративная штукатурка\r\n— потолки: подвесные типа «Армстронг»\r\n<strong>Внутренняя отделка квартир и офисных помещений</strong>\r\n— полы: стяжка армированная фиброволокном (за исключением с/узлов) с устройством звуко- и теплоизоляции «Терафом»\r\n— стены – газобетонные блоки\r\n<strong>Отопление</strong>\r\nВ каждой квартире устанавливается теплосчетчик, что позволит платить за реально потребленное тепло.\r\nВ качестве нагревательных приборов в квартирах устанавливаются радиаторы с терморегуляторами, что позволит регулировать потребление тепла.\r\nСистема отопления – закрытая с принудительной циркуляцией, двухтрубная, поквартирная, с установкой поэтажной распределительной гребенки в общем коридоре.\r\nТрубы отопления — пластиковые, проложены в толще пола в изоляции.\r\nИсточником теплоснабжения служат индивидуальные крышные газовые котельные.\r\nКотлы с высоким КПД и низким потреблением газа ведущего европейского производителя фирмы Riello RTQ (Италия), которая является поставщиком комплектующих фирмы Viessmann.\r\nНасоcное оборудование фирмы Wilo, являющейся мировым производителем насосного оборудования для систем отопления, вентиляции, кондиционирования (Германия).\r\nРегулирующее оборудование и теплообменное оборудование Danfoss (Дания).\r\n<strong>Вентиляция</strong>\r\nВытяжная вентиляция жилых квартир предусмотрена естественная через бетонные вытяжные каналы, выполненные по итальянской технологии, которые обеспечивают герметичность, надежность и долговечность.\r\nНа кровле в вентканалах встраивается обратный клапан для предотвращения явления «обратной тяги», нагнетающего зимой холодный воздух в с/узлы и кухни.\r\n<strong>Водоснабжение и канализация </strong>\r\nТрубы холодного водоснабжения — из полипропилена.\r\nТрубы горячего водоснабжения – полипропиленовые Stabi\r\nНа вводе в каждую квартиру устанавливается водомер.\r\nДля обеспечения бесперебойного водоснабжения всего дома, запроектированы водопроводные насосные станции фирмы Grundfos (Германия) с посекционной установкой баков запаса воды в объеме суточной нормы потребления.\r\nХозяйственно-бытовая канализация здания выполняется из полипропиленовых труб.\r\n<strong>Электроснабжение </strong>\r\nПоквартирный учет электроэнергии осуществляется электронными счетчиками.\r\nМагистрали к этажным, квартирным щиткам, к лифтам, к щиту котельной, рабочее освещение лестничных клеток предусматривается медными кабелями, не распространяющими горение с малым дымо- и газовыделением. Магистрали к щитам дымоудаления, щиту заградительных огней, аварийно-эвакуационного освещения незадымляемых лестничных клеток и лифтовых холлов – кабелем Flame-X-950, стойким к распространению пламени, имеющим умеренную дымообразующую способность, малоопасных по токсичности продуктов горения. Предусматривается резервное электроснабжение: два независимых электрических ввода.\r\n<strong>Противопожарные мероприятия</strong><strong>\r\n</strong>При строительстве комплекса применяются современные строительные и отделочные материалы, конструкции и инженерные системы, обеспечивающие противопожарную защиту. Жилой дом оборудуется средствами противопожарной защиты:\r\n— системами противопожарной автоматики;\r\n— устройством аварийного освещения;\r\n— соблюдением огнестойкости конструкций.\r\nЖилые дома комплекса оборудуются системой молниезащиты.\r\n<strong>Системы противопожарной автоматики</strong><strong>\r\n</strong>При строительстве комплекса применяются следующие системы противопожарной автоматики:       — система автоматической пожарной сигнализации;\r\n— автоматическая система спринклерного пожаротушения в паркинге. Система имеет резервный запас воды достаточный для тушения пожара в нормативный промежуток времени до прибытия пожарных расчетов;\r\n— система противодымной защиты. Включение систем дымоудаления осуществляется автоматически от системы пожарной сигнализации;\r\n— система внутреннего противопожарного водопровода;\r\n—  система автоматического пожаротушения в котельной и машинных помещениях лифтов для транспортировки пожарных подразделений.\r\n<strong>Техническое и эксплуатационное насыщение дома</strong>\r\nЖилой дома комплекса оборудуются системами контроля удаленного доступа.\r\nПридомовая территория комплекса, паркинг, входные группы обеспечиваются системой круглосуточного видеонаблюдения с выводом информации на пункт охраны объекта, который расположен на территории.\r\n<strong>Автоматизация</strong>\r\nПри проектировании жилого дома были обеспечены следующие системы автоматизации:\r\n— автоматическое отключение вентиляционных систем паркинга за исключением систем противодымной защиты.\r\n<strong>Шумозащитные мероприятия</strong>\r\nОбеспечивается ряд шумозащитных мероприятий, включающих в себя:\r\n— применение оконных и дверных блоков из металлопластика, имеющих герметичные звукоизоляционные прокладки;\r\n— установку вентиляторов на виброизолирующих основаниях;\r\n— установку оборудования автономного теплоснабжения (котельных) на шумо- и виброизолирующей системе «плавающий пол»;\r\n— установку шумоглушителей в системах вентиляции.\r\nОтличительной особенностью комплекса является устройство стяжки с применением шумо- и звукоизоляции «Терафом», которая также препятствует тепловым потерям.'),
