(18845, 1254, 'галерея_дома', '<img class="alignnone size-full wp-image-1345" src="http://novostroy/wp-content/uploads/2018/02/4.RGB_color1.jpg" alt="" width="1280" height="1515" /> <img class="alignnone size-medium wp-image-1346" src="http://novostroy/wp-content/uploads/2018/02/c5.RGB_color.jpg" alt="" width="1280" height="1643" /> <img class="alignnone size-medium wp-image-1347" src="http://novostroy/wp-content/uploads/2018/02/3.RGB_color.jpg" alt="" width="1280" height="1643" /> <img class="alignnone size-medium wp-image-1348" src="http://novostroy/wp-content/uploads/2018/02/2g.RGB_color.jpg" alt="" width="1280" height="1395" /> <img class="alignnone size-medium wp-image-1349" src="http://novostroy/wp-content/uploads/2018/02/1v.RGB_color.jpg" alt="" width="1280" height="1643" /> <img class="alignnone size-medium wp-image-1350" src="http://novostroy/wp-content/uploads/2018/02/00_View03n.jpg" alt="" width="1280" height="1643" />'),
