(18849, 1254, 'короткое_описание', '«28 Жемчужина» на Баштанной. Современный 5-этажный жилой дом в непосредственной близости от моря в экологически чистом районе города между 9й и 10й станциями Б.Фонтана. '),
(18850, 1254, '_короткое_описание', 'field_5a78b4b9e5d81'),
(18851, 1254, 'описание', '«28 Жемчужина» на Баштанной. Современный 5-этажный жилой дом в непосредственной близости от моря в экологически чистом районе города между 9й и 10й станциями Б.Фонтана. Проект предусматривает использование высококачественных экологически чистых материалов, передовые технологии строительства, архитектурные детали, приближающие дом к лучшим шедеврам приморской архитектуры. Будущих жильцов ждет счастливая жизнь с комфортом: зеленая зона для отдыха, развитая инфраструктура, высокий уровень обслуживания, круглосуточная охрана и видеонаблюдение, удобный паркинг, обустроенные места для семейного отдыха. «Двадцать Восьмая Жемчужина» составит дуэт с «Двадцать Третьей Жемчужиной» и воплотит в жизнь мечты многих одесситов.'),
