(18913, 1255, 'короткое_описание', 'Жилмассив «Радужный 2» строительной компании ООО «Руником-Строинвест» территориально расположен в Одессе в Киевском районе. Строительство жилого массива «Радужный 2» реализуется на земле Таировского Сельсовета (бывший виноградник), район пересечения ул. Левитана/ Маршала Жукова.'),
(18914, 1255, '_короткое_описание', 'field_5a78b4b9e5d81'),
(18915, 1255, 'описание', '<div class=" col-md-9 rightmargin ">\r\n<div class="single-content listing-content">\r\n\r\nЖилмассив «Радужный 2» строительной компании ООО «Руником-Строинвест» территориально расположен в Одессе в Киевском районе. Строительство жилого массива «Радужный 2» реализуется на земле Таировского Сельсовета (бывший виноградник), район пересечения ул. Левитана/ Маршала Жукова.\r\n\r\n<strong>Квартиры в ЖК «Радужный» снабжены:</strong>\r\n<ul>\r\n 	<li>металлопластиковые окна;</li>\r\n 	<li>цифровая телефонная связь, интернет, кабельное телевидение;</li>\r\n 	<li>приборы учета: счетчики учета водопотребления и электросчетчики;</li>\r\n 	<li>домофоны;</li>\r\n 	<li>радиаторы отопления;</li>\r\n 	<li>электропроводка проводка — медная трехжильная;</li>\r\n 	<li>входные двери — бронированные;</li>\r\n 	<li>высота потолков в жилых помещениях — 2,8 метра с отделочными работами.</li>\r\n</ul>\r\nЦокольные этажи в каждом здании выделены под коммерческую недвижимость, предоставляя жителям все необходимые товары и услуги в непосредственной близости к дому. За последние два года здесь появились несколько аптек, мясная и фруктовая лавки, несколько супермаркетов, паб, салоны красоты, пиццерия, ресторан китайской кухни, авто-мойка, фитнес-центр, прочее.<strong> </strong>\r\n\r\n<strong>Территория жилого комплекса:</strong>\r\n<ul>\r\n 	<li>асфальтированные пешеходные дорожки и дороги для транспорта;</li>\r\n 	<li>озеленение придомовых территорий;</li>\r\n 	<li>подземный и гостевой паркинг;</li>\r\n 	<li>детские площадки;</li>\r\n 	<li>фонтан;</li>\r\n 	<li>своя инфраструктура.</li>\r\n</ul>\r\n&nbsp;\r\n\r\n</div>\r\n</div>\r\n<div id="primary" class="col-xs-12 col-md-3 widget-area-sidebar"></div>'),
