(18977, 1256, 'короткое_описание', 'В составе двух жилых домов этажностью 24 этажа + технический этаж предусматривается — квартиры, апартаменты и офисы, охраняемая территория с оборудованными площадками для отдыха и занятия спортом детей и взрослых, подземный паркинг.'),
(18978, 1256, '_короткое_описание', 'field_5a78b4b9e5d81'),
(18979, 1256, 'описание', 'В составе двух жилых домов этажностью 24 этажа + технический этаж предусматривается — квартиры, апартаменты и офисы, охраняемая территория с оборудованными площадками для отдыха и занятия спортом детей и взрослых, подземный паркинг.\r\n\r\n<strong>Техническое состояние квартир и офисов при передаче их владельцам.</strong>\r\n\r\nОтделка помещений не выполняется.\r\n\r\nПолы – двухслойная стяжка с нижним слоем из политермбетона с наполнителем из пенополистирольных шариков, и верхним слоем – цементной стяжки.  В санузлах стяжка и гидроизоляция не выполняется.\r\n\r\nОстекление – однокамерный стеклопакет, с энергосберегающим покрытием.\r\n\r\nОтопление – выполняется в полном объеме с установкой радиаторов.\r\n\r\nВодоснабжение – ввод холодной и горячей воды от счетчиков водоснабжения, расположенных в коридоре общего пользования.\r\n\r\nЭлектроснабжение – ввод электропроводки в квартиру от электронных счетчиков учета электроэнергии, расположенных в холле.\r\n\r\nВходная дверь – бронированная.'),
