(19037, 1257, 'галерея_дома', '<img class="alignnone size-full wp-image-1355" src="http://novostroy/wp-content/uploads/2018/02/beletazh-all-plans-section-1.jpg" alt="" width="835" height="773" /> <img class="alignnone size-medium wp-image-1356" src="http://novostroy/wp-content/uploads/2018/02/beletazh-all-plans-section-1-floor-16.jpg" alt="" width="835" height="772" /> <img class="alignnone size-full wp-image-1357" src="http://novostroy/wp-content/uploads/2018/02/beletazh-all-plans-section-1-floor-17.jpg" alt="" width="835" height="774" />'),
