(19041, 1257, 'короткое_описание', 'Жилой дом двухсекционный, 17-ти этажный, в цокольном этаже предусматривается устройство подземного паркинга.'),
(19042, 1257, '_короткое_описание', 'field_5a78b4b9e5d81'),
(19043, 1257, 'описание', '<div class=" col-md-9 rightmargin ">\r\n<div class="single-content listing-content">\r\n\r\nЖилой дом двухсекционный, 17-ти этажный, в цокольном этаже предусматривается устройство подземного паркинга.\r\n\r\n<strong>Квартиры в ЖК «Бельэтаж» снабжены:</strong>\r\n\r\nОтделка помещений не выполняется.\r\n\r\nПолы – двухслойная стяжка. Нижний слой из политермбетона с наполнителем из пенополистирольных шариков. Верхний слой – цементная стяжка.  В санузлах стяжка и гидроизоляция не выполняется.\r\n\r\nОстекление: Профиль металлопластиковый пятикамерный, для заполнения используется двухкамерный энергосберегающий стеклопакет. Цвет переплетов – коричневый, под дерево.\r\n\r\nОтопление – выполняется в полном объеме с установкой радиаторов.\r\n\r\nВодоснабжение – ввод холодной и горячей воды от счетчиков водоснабжения, расположенных в коридоре общего пользования.\r\n\r\nЭлектроснабжение – ввод электропроводки в квартиру от электронных счетчиков учета электроэнергии, расположенных в холле.\r\n\r\nВходная дверь – бронированная.\r\n\r\n<strong>Жилые дома оборудуются средствами противопожарной защиты:</strong>\r\n<ul>\r\n 	<li>устройство эвакуационного освещения;</li>\r\n 	<li>регламентация огнестойкости конструкций;</li>\r\n 	<li>система дымоудаления.</li>\r\n</ul>\r\n<strong>Территория жилого комплекса:</strong>\r\n<ul>\r\n 	<li>асфальтированные пешеходные дорожки и дороги для транспорта;</li>\r\n 	<li>озеленение придомовых территорий;</li>\r\n 	<li>подземный и гостевой паркинг;</li>\r\n 	<li>детские и спортивные площадки;</li>\r\n 	<li>охраняемая территория.</li>\r\n</ul>\r\n&nbsp;\r\n\r\n</div>\r\n</div>'),
