(19165, 1259, 'галерея_дома', '<img class="alignnone size-full wp-image-1365" src="http://novostroy/wp-content/uploads/2018/02/29ZH-1-s-1et-1024x481.png" alt="" width="1024" height="481" /> <img class="alignnone size-medium wp-image-1366" src="http://novostroy/wp-content/uploads/2018/02/29zh-1-s-2-3-et-1024x476.jpg" alt="" width="1024" height="476" /> <img class="alignnone size-medium wp-image-1367" src="http://novostroy/wp-content/uploads/2018/02/29zh-1-s-4-18-e-1024x457.jpg" alt="" width="1024" height="457" /> <img class="alignnone size-medium wp-image-1368" src="http://novostroy/wp-content/uploads/2018/02/29zh-2-s-1-3-e-1024x426.jpg" alt="" width="1024" height="426" /> <img class="alignnone size-medium wp-image-1369" src="http://novostroy/wp-content/uploads/2018/02/29zh-2-s-4-18-e-1024x496.jpg" alt="" width="1024" height="496" /><img class="alignnone size-medium wp-image-1362" src="http://novostroy/wp-content/uploads/2018/02/46.jpg" alt="" width="1920" height="1080" /> <img class="alignnone size-medium wp-image-1363" src="http://novostroy/wp-content/uploads/2018/02/19.jpg" alt="" width="1920" height="1080" /> <img class="alignnone size-medium wp-image-1364" src="http://novostroy/wp-content/uploads/2018/02/211.jpg" alt="" width="1322" height="1080" />'),
