(19293, 1261, 'галерея_дома', '<img class="alignnone size-full wp-image-1372" src="http://novostroy/wp-content/uploads/2018/02/411_Int_Glass.jpg" alt="" width="4608" height="3072" /> <img class="alignnone size-medium wp-image-1373" src="http://novostroy/wp-content/uploads/2018/02/275585429.jpg" alt="" width="800" height="533" /> <img class="alignnone size-medium wp-image-1374" src="http://novostroy/wp-content/uploads/2018/02/1-3-5-sektsiya-1024x678.jpg" alt="" width="1024" height="678" /> <img class="alignnone size-medium wp-image-1375" src="http://novostroy/wp-content/uploads/2018/02/2-sektsiya-1024x741.jpg" alt="" width="1024" height="741" /> <img class="alignnone size-medium wp-image-1376" src="http://novostroy/wp-content/uploads/2018/02/4-sektsiya-1024x751.jpg" alt="" width="1024" height="751" />'),
