(19297, 1261, 'короткое_описание', 'Хотим представить Вашему вниманию наш новый проект!\r\nМы создаем оазис среди высоких каменных стен душного города.  У Вас есть возможность жить у берега Черного моря и каждое утро наблюдать этот прекрасный вид из окна. Здесь мы совместим современные системы, которые позволят сделать проживание более комфортным, при этом сохранив эксклюзивный экстерьер нашим малоэтажных домов.'),
(19298, 1261, '_короткое_описание', 'field_5a78b4b9e5d81'),
(19299, 1261, 'описание', '<strong>Комплекс апартаментов «</strong><strong>Club </strong><strong>Marine</strong><strong>»  — </strong>Апартаменты у моря. Место имеет значение.\r\n\r\nХотим представить Вашему вниманию наш <strong>новый проект</strong>!\r\nМы создаем оазис среди высоких каменных стен душного города.  У Вас есть возможность<strong> жить у берега Черного моря </strong>и каждое утро наблюдать этот прекрасный вид из окна. Здесь мы совместим современные системы, которые позволят сделать проживание более комфортным, при этом сохранив эксклюзивный экстерьер нашим малоэтажных домов.\r\n\r\nБлизость к деловому центру города, удобная транспортная развязка позволит попасть на основные транспортные артерии города, <strong>33 гектара парка</strong> «411 батареи» под Вашими окнами –идеальное сочетание для жизни в мегаполисе. До ближайших учебных заведений около 10 минут езды на любом транспорте, супермаркет на территории комплекса, охраняемая парковка, ухоженные зеленые зоны с детскими площадками превратят городские будни в загородный отдых. На закрытой внутренней территории Вы всегда будете чувствовать себя <strong>спокойно и уютно</strong>.\r\n\r\n<em>ТЕХНИЧЕСКИЕ ХАРАКТЕРИСТИКИ:</em>\r\n<ul>\r\n 	<li>Фундамент и межэтажные перекрытия: монолитная ЖБ плита.</li>\r\n 	<li>Конструктивная схема здания: монолитный безригельный каркас.</li>\r\n 	<li>Материал постройки:</li>\r\n 	<li>— наружных стен (толщина, см): пенообетон, 40 см;</li>\r\n 	<li>— межквартирных стен (толщина, см): пенобетон, 20 см;</li>\r\n 	<li>— внутриквартирных стен (толщина, см): пенобетон, 12 см;</li>\r\n 	<li>— стены подвала и техэтажа: монолитные ЖБ.</li>\r\n 	<li>Кровля: метало-черепица.</li>\r\n 	<li>Пол (с/у, комнаты, кухня): цементная стяжка с гидроизоляцией.</li>\r\n 	<li>Высота потолков (м):</li>\r\n 	<li>— квартир — 3 м;</li>\r\n 	<li>— тех. этажа — 3 м;</li>\r\n 	<li>— паркинг – 2.5 м.</li>\r\n 	<li>Система отопления: индивидуальная система отопления с принудительной циркуляцией воды(газовый котел за счет клиентов.), 2-трубная горизонтальная тупиковая.</li>\r\n 	<li>Отопительные приборы: радиаторы стальные.</li>\r\n 	<li>Газоснабжение от городского газопровода.</li>\r\n 	<li>Окна: металлопластиковые стеклопакеты, панорамное остекление.</li>\r\n 	<li>Наличие входной двери: металлическая.</li>\r\n 	<li>Инженерные сети по дому: металлопластиковые.</li>\r\n 	<li>Электропроводка: медная трехжильная.</li>\r\n 	<li>Наличие приборов учета: эл/энергии, газа, холодной воды.</li>\r\n 	<li>Лифт: пассажирский из паркинга.</li>\r\n 	<li>Водоснабжение: городское, так же на территории предусмотрен бювет с питьевой водой от собственной скважины глубина которой 140 м.;</li>\r\n 	<li>Паркинг: высота паркинга – 2,5 м, количество мест под секцией – от 15 до 21</li>\r\n 	<li>Количество паркомест возле секций – 15-20</li>\r\n 	<li>Придомовая территория – 15-35 метров</li>\r\n 	<li>Спуск к морю непосредственно с территории комплекса будет готов при сдаче <strong>2-й очереди</strong> 3 квартала 2018 года.</li>\r\n 	<li>Бронирование квартиры возможно на 5 дней (если покупатель не покупает квартиру в срок 3 дня то следующий на очереди вправе на 4-й день выкупить квартиру, если нету других на очереди то бронь действует 5 дней после этого бронь снимается;</li>\r\n 	<li>Рассрочка 0% только на 1 год;</li>\r\n 	<li>Возможна поэтапная оплата, первый платеж не меньше 50% от стоимости квартиры;</li>\r\n 	<li>Апартаменты будут делаться жилым фондом до конца строительства за счет застройщика;</li>\r\n 	<li>При покупке стороны подписывают договор ассоциированного членства в кооперативе/выкупе пая;</li>\r\n 	<li>Право собственности получают на единицу а не часть!</li>\r\n 	<li>При прописке регистрируются как в Одессе, Киевский район, а не область!</li>\r\n 	<li>Расчет как наличный так и безналичный;</li>\r\n 	<li>Вознаграждение проводится следующим образом( если покупатель платит наличными то оплачивается наличными, если безналом то на ваш расчетный счет!)</li>\r\n 	<li>Сроки сдачи первой очереди (1-5 секции) конец осени 2017 года;</li>\r\n</ul>\r\nИнфраструктура апартаментов:\r\n<ol>\r\n 	<li>Недалеко от моря – до моря 400 метров;</li>\r\n 	<li>До парка – 50 метров;</li>\r\n 	<li>Большая придомовая территория.</li>\r\n 	<li>Высокие потолки/панорамные окна, отличный вид как на море так и на парк;</li>\r\n 	<li>До ближайшего супермаркета – 2,5 км. На машине 5 минут. (планируется размещение супермаркета непосредственно в апартаментах).</li>\r\n 	<li>Магазин – в 250 метрах;</li>\r\n 	<li>Рынок Южный в 7-10 минутах езды, Киевский в 10-12 минутах;</li>\r\n 	<li>Круглосуточная Аптека в 5 минутах (планируется размещение в апартаментах),</li>\r\n 	<li>Школы 4 шт. в 5-10 минутах езды;</li>\r\n 	<li>Детские сады 4 шт. в 5-10 мин. езды.</li>\r\n</ol>'),
