(19431, 1268, 'галерея_дома', '<img class="alignnone size-full wp-image-1402" src="http://novostroy/wp-content/uploads/2018/02/19ZH-1-s-1024x538.jpg" alt="" width="1024" height="538" /> <img class="alignnone size-medium wp-image-1403" src="http://novostroy/wp-content/uploads/2018/02/19-zh-2-s-1024x528.jpg" alt="" width="1024" height="528" /><img class="alignnone size-medium wp-image-1399" src="http://novostroy/wp-content/uploads/2018/02/33.jpg" alt="" width="1000" height="1073" /> <img class="alignnone size-medium wp-image-1400" src="http://novostroy/wp-content/uploads/2018/02/42.jpg" alt="" width="766" height="976" /> <img class="alignnone size-medium wp-image-1401" src="http://novostroy/wp-content/uploads/2018/02/26.jpg" alt="" width="956" height="1024" />'),
