(19435, 1268, 'короткое_описание', 'ЖК«19 Жемчужина»  — 22-х этажный проект компании «KADORR Group».  Французский бульвар – один из самых привлекательных районов нашего города … '),
(19436, 1268, '_короткое_описание', 'field_5a78b4b9e5d81'),
(19437, 1268, 'описание', 'ЖК«19 Жемчужина»  — 22-х этажный проект компании «KADORR Group».  Французский бульвар – один из самых привлекательных районов нашего города … Так сложилось исторически, что протянувшийся более чем на три километра вдоль морского побережья, бульвар еще со времен основания Одессы стал дачным местом, где селились именитые горожане.\r\nСвоей привлекательности этот район не теряет и сейчас. Как и во всех комплексах от KADORR в «Девятнадцатая Жемчужине» будут обустроены светлые просторные парадные и коридоры, собственная служба охраны и эксплуатации, система видеонаблюдения. Это европейский подход в строительстве и обслуживании домов.'),
