(19499, 1269, 'короткое_описание', 'апартаменты от 41 до 59 м²;\r\nкоммерческие помещения;\r\nгостевая автостоянка;\r\nохраняемая территория с местами отдыха для детей и взрослых;'),
(19500, 1269, '_короткое_описание', 'field_5a78b4b9e5d81'),
(19501, 1269, 'описание', 'В составе 15-ти этажного здания предусматривается:\r\n\r\nапартаменты от 41 до 59 м²;\r\nкоммерческие помещения;\r\nгостевая автостоянка;\r\nохраняемая территория с местами отдыха для детей и взрослых;\r\nКонструктивная характеристика здания.\r\nКонструктивная схема здания – несущие стены из силикатного кирпича.\r\nФундамент здания – монолитный железобетонный ленточный ростверк по свайному основанию.\r\nНаружные и внутренние несущие стены выполнены в кладке из силикатного кирпича толщиной 510 мм, 640 мм.\r\nФасадные стены утепляются негорючими минераловатными плитами, оштукатуриваются и окрашиваются фасадными красками.'),
