(19561, 1271, 'галерея_дома', '<img class="alignnone size-full wp-image-1411" src="http://novostroy/wp-content/uploads/2018/02/bereg-all-plans-section-1-floor-4-8-519x1024.jpg" alt="" width="519" height="1024" /> <img class="alignnone size-medium wp-image-1412" src="http://novostroy/wp-content/uploads/2018/02/bereg-all-plans-section-1-floor-9-14-519x1024.jpg" alt="" width="519" height="1024" /> <img class="alignnone size-medium wp-image-1413" src="http://novostroy/wp-content/uploads/2018/02/bereg-all-plans-section-1-floor-15-25-519x1024.jpg" alt="" width="519" height="1024" /><img class="alignnone size-full wp-image-1409" src="http://novostroy/wp-content/uploads/2018/02/11-2.jpg" alt="" width="835" height="555" /> <img class="alignnone size-medium wp-image-1410" src="http://novostroy/wp-content/uploads/2018/02/21-1.jpg" alt="" width="835" height="555" />'),
(19562, 1271, '_галерея_дома', 'field_5a81ef23f27ab'),
(19563, 1271, 'дом_на_карте', ''),
(19564, 1271, '_дом_на_карте', 'field_5a8dd29437cba'),
(19565, 1271, 'короткое_описание', '24-этажный жилой комплекс + технический этаж'),
(19566, 1271, '_короткое_описание', 'field_5a78b4b9e5d81'),
(19567, 1271, 'описание', '24-этажный жилой комплекс + технический этаж\r\n\r\n<strong>Квартиры в ЖК «Новый берег» снабжены:</strong>\r\n<ul>\r\n 	<li>Отделка помещений не выполняется.</li>\r\n 	<li>Полы – двухслойная стяжка с нижним слоем из политермбетона с наполнителем из пенополистирольных шариков, и верхним слоем – цементной стяжки.  В санузлах стяжка и гидроизоляция не выполняется.</li>\r\n 	<li>Остекление комбинированное: панорамное в сочетании со стандартным, стеклопакет – однокамерный, с энергосберегающим покрытием.</li>\r\n 	<li>Отопление – выполняется в полном объеме с установкой радиаторов.</li>\r\n 	<li>Водоснабжение – ввод холодной и горячей воды от счетчиков водоснабжения, расположенных в коридоре общего пользования.</li>\r\n 	<li>Электроснабжение – ввод электропроводки в квартиру от электронных счетчиков учета электроэнергии, расположенных в холле.</li>\r\n 	<li>Входная дверь – бронированная.</li>\r\n</ul>\r\n<strong>Жилой комплекс оборудуется средствами противопожарной защиты:</strong>\r\n<ul>\r\n 	<li>устройство эвакуационного освещения\r\nрегламентация огнестойкости конструкций\r\nсистема дымоудаления <strong> </strong></li>\r\n</ul>\r\n<strong>Территория жилого комплекса:</strong>\r\n<ul>\r\n 	<li>асфальтированные пешеходные дорожки и дороги для транспорта;</li>\r\n 	<li>озеленение придомовых территорий;</li>\r\n 	<li>подземный и гостевой паркинг;</li>\r\n 	<li>детские и спортивные площадки;</li>\r\n 	<li>охраняемая территория.</li>\r\n</ul>'),
