(19629, 1272, 'короткое_описание', 'Над частным сектором и новыми высотками Аркадии поднимается к небу роскошный, спроектированный каскадами, 15-этажный жилой комплекс по пер. Клубничный. Южная столица лета и высокой моды может по праву гордиться таким приобретением. В двух парадных располагается 225 квартир, повышенной комфортности.'),
