(19689, 1273, 'галерея_дома', '<img class="alignnone size-full wp-image-1415" src="http://novostroy/wp-content/uploads/2018/02/71.jpg" alt="" width="1920" height="1600" /> <img class="alignnone size-medium wp-image-1416" src="http://novostroy/wp-content/uploads/2018/02/16.jpg" alt="" width="1920" height="1600" /> <img class="alignnone size-medium wp-image-1417" src="http://novostroy/wp-content/uploads/2018/02/27.jpg" alt="" width="1096" height="1600" /> <img class="alignnone size-medium wp-image-1418" src="http://novostroy/wp-content/uploads/2018/02/34.jpg" alt="" width="1162" height="1600" /> <img class="alignnone size-medium wp-image-1419" src="http://novostroy/wp-content/uploads/2018/02/20zh-1-sekts-nechet-1024x484.jpg" alt="" width="1024" height="484" /> <img class="alignnone size-medium wp-image-1420" src="http://novostroy/wp-content/uploads/2018/02/20-zh-1-sekts-chet-1024x478.jpg" alt="" width="1024" height="478" /> <img class="alignnone size-medium wp-image-1421" src="http://novostroy/wp-content/uploads/2018/02/20-zh-2-s-neche-1024x494.jpg" alt="" width="1024" height="494" /> <img class="alignnone size-medium wp-image-1422" src="http://novostroy/wp-content/uploads/2018/02/20-zh-2-s-chet-1024x499.jpg" alt="" width="1024" height="499" /> <img class="alignnone size-medium wp-image-1423" src="http://novostroy/wp-content/uploads/2018/02/20zh-3-s-nechet-1024x515.jpg" alt="" width="1024" height="515" /> <img class="alignnone size-medium wp-image-1424" src="http://novostroy/wp-content/uploads/2018/02/20-zh-3-s-chet-1024x484.jpg" alt="" width="1024" height="484" />'),
