(19693, 1273, 'короткое_описание', 'ЖК «20 жемчужина» — современный 17-ти этажный жилой комплекс европейского уровня, появится в нашем городе в 2017 году. Новый дом будет возведен в молодом и перспективном районе города — Суворовском. '),
(19694, 1273, '_короткое_описание', 'field_5a78b4b9e5d81'),
(19695, 1273, 'описание', '<div class=" col-md-9 rightmargin ">\r\n<div class="single-content listing-content">\r\n\r\nЖК «20 жемчужина» — современный 17-ти этажный жилой комплекс европейского уровня, появится в нашем городе в 2017 году. Новый дом будет возведен в молодом и перспективном районе города — Суворовском. Дом будет спроектирован с учетом последних достижений в области архитектуры, а его дизайн выгодно выделит комплекс на фоне остальных объектов в этом районе. Специалисты компании «KADORR Group» позаботились о безопасности и комфорте будущих жильцов «Двадцатой Жемчужины». По всему периметру дома, а также на этажах, будут установлены камеры видео-наблюдения. А во дворе дома будет расположена детская площадка и обустроены зоны для ожидания и отдыха.\r\n\r\n&nbsp;\r\n\r\n</div>\r\n</div>'),
