(19753, 1274, 'галерея_дома', '<img class="alignnone size-full wp-image-1425" src="http://novostroy/wp-content/uploads/2018/02/c_04_1.jpg" alt="" width="1334" height="1611" /> <img class="alignnone size-full wp-image-1428" src="http://novostroy/wp-content/uploads/2018/02/34-1-sekts-1-et-1024x589.jpg" alt="" width="1024" height="589" /> <img class="alignnone size-medium wp-image-1429" src="http://novostroy/wp-content/uploads/2018/02/34-1-sekts-2-4-et-1024x602.jpg" alt="" width="1024" height="602" /> <img class="alignnone size-medium wp-image-1430" src="http://novostroy/wp-content/uploads/2018/02/34-1-sekts-5-24-et-1024x589.jpg" alt="" width="1024" height="589" /> <img class="alignnone size-medium wp-image-1431" src="http://novostroy/wp-content/uploads/2018/02/34-2-sekts-1-et-1024x595.jpg" alt="" width="1024" height="595" /> <img class="alignnone size-full wp-image-1432" src="http://novostroy/wp-content/uploads/2018/02/34-2-sekts-2-4-et-1024x560.jpg" alt="" width="1024" height="560" /><img class="alignnone size-medium wp-image-1426" src="http://novostroy/wp-content/uploads/2018/02/1_day.jpg" alt="" width="1334" height="2000" /> <img class="alignnone size-medium wp-image-1427" src="http://novostroy/wp-content/uploads/2018/02/2_day.jpg" alt="" width="1334" height="1844" />'),
