(19757, 1274, 'короткое_описание', '«34 Жемчужина» на Бассейной – долгожданный проект от компании KADORR Group, который вдохнет новую жизнь и даст начало развитию современного района.'),
(19758, 1274, '_короткое_описание', 'field_5a78b4b9e5d81'),
(19759, 1274, 'описание', '«34 Жемчужина» на Бассейной – долгожданный проект от компании KADORR Group, который вдохнет новую жизнь и даст начало развитию современного района. Новый 24-этажный жилой комплекс сочетает в себе европейские традиции строительства и демократичный подход компании к формированию ценовой политики. Облагороженная придомовая территория, собственная служба охраны и эксплуатации, система видеонаблюдения и пожарной безопасности – это высококлассный подход в обеспечении комфорта жильцов дома. Комплекс расположен совсем рядом с центром города вблизи знаменитого рынка Привоз и Железнодорожный вокзал.'),
