(19817, 1275, 'галерея_дома', '<img class="alignnone size-medium wp-image-1434" src="http://novostroy/wp-content/uploads/2018/02/Obshhij-plan-1-sektsiya.jpg" alt="" width="978" height="591" /> <img class="alignnone size-medium wp-image-1435" src="http://novostroy/wp-content/uploads/2018/02/Obshhj-plan-2-sektsiya-1024x555.jpg" alt="" width="1024" height="555" /> <img class="alignnone size-medium wp-image-1436" src="http://novostroy/wp-content/uploads/2018/02/4.jpg" alt="" width="920" height="400" /> <img class="alignnone size-medium wp-image-1437" src="http://novostroy/wp-content/uploads/2018/02/12.jpg" alt="" width="640" height="456" /> <img class="alignnone size-medium wp-image-1438" src="http://novostroy/wp-content/uploads/2018/02/3-835x400.jpg" alt="" width="835" height="400" /> <img class="alignnone size-medium wp-image-1439" src="http://novostroy/wp-content/uploads/2018/02/6-835x400.jpg" alt="" width="835" height="400" /> <img class="alignnone size-medium wp-image-1440" src="http://novostroy/wp-content/uploads/2018/02/5-835x400.jpg" alt="" width="835" height="400" />'),
