(19820, 1275, '_дом_на_карте', 'field_5a8dd29437cba'),
(19821, 1275, 'короткое_описание', 'ЖК «МАРШАЛ-СИТИ» Фактически расположен на пр-те Маршала Жукова неподалеку от ТЦ Метро. Комплекс будет состоять из 5-ти домов по 16 этажей + 2 паркинга.'),
(19822, 1275, '_короткое_описание', 'field_5a78b4b9e5d81'),
(19823, 1275, 'описание', '<strong>ЖК «МАРШАЛ-СИТИ»</strong> Фактически расположен на пр-те Маршала Жукова неподалеку от ТЦ Метро. Комплекс будет состоять из 5-ти домов по 16 этажей + 2 паркинга.\r\n\r\nВ каждой секции просторный холл с качественной и дорогой отделкой. Меблированное место ожидания, платёжный терминал, место для хранения колясок и велосипедов. Предусмотрено отдельное помещение для размещения обслуживающей компании. Комплекс обеспечен круглосуточной охраной и видеонаблюдением. Территория микрорайона изолирована, въезд и вход на территорию осуществляется по пропускам или с помощью ключей-домофона. Современное архитектурное решение, соответствующее уровню комфорт-класса.\r\n\r\n<strong>Благоустройство прилегающей территории:</strong>\r\n<ul>\r\n 	<li>Стильный ландшафтный дизайн;</li>\r\n 	<li>Точечное освещение;</li>\r\n 	<li>Несколько качественных детских площадок;</li>\r\n 	<li>Спортивная тренажёрная площадка;</li>\r\n</ul>\r\n<strong>Этапы строительства нового дома в Одессе в жилом комплексе</strong><strong> «МАРШАЛ-СИТИ», Таирово</strong><strong> :</strong>\r\n<ul>\r\n 	<li>1-ая очередь: 1, 2 дом -4 квартал 2017г.</li>\r\n 	<li>2-ая очередь: 3, 4 дом;</li>\r\n 	<li>3-я очередь: 5  дом;</li>\r\n 	<li>4-ая очередь: паркинги;</li>\r\n</ul>'),
