(19945, 1277, 'галерея_дома', '<img class="alignnone size-medium wp-image-1448" src="http://novostroy/wp-content/uploads/2018/02/s_02.RGB_color-000.jpg" alt="" width="1920" height="1728" /> <img class="alignnone size-medium wp-image-1449" src="http://novostroy/wp-content/uploads/2018/02/c_02d.RGB_color-000.jpg" alt="" width="1920" height="1728" /> <img class="alignnone size-medium wp-image-1450" src="http://novostroy/wp-content/uploads/2018/02/c_04.RGB_color-000.jpg" alt="" width="1920" height="1728" /> <img class="alignnone size-medium wp-image-1451" src="http://novostroy/wp-content/uploads/2018/02/c_05.RGB_color-000.jpg" alt="" width="1920" height="1728" /> <img class="alignnone size-medium wp-image-1452" src="http://novostroy/wp-content/uploads/2018/02/c_06.RGB_color-000.jpg" alt="" width="1920" height="1728" /> <img class="alignnone size-medium wp-image-1453" src="http://novostroy/wp-content/uploads/2018/02/s_01.RGB_color-000.jpg" alt="" width="1920" height="1728" />'),
