(19949, 1277, 'короткое_описание', 'ЖК «22 Жемчужина» будет возведена в центре легендарного района — Молдаванки, на улице Болгарской, рядом с Алексеевской площадью. Колорит старинных уличек Молдаванки в сочетании с высочайшим европейским качеством строительства и обслуживания дома – это мечта многих одесситов. '),
(19950, 1277, '_короткое_описание', 'field_5a78b4b9e5d81'),
(19951, 1277, 'описание', '<strong>ЖК «22 Жемчужина</strong>» будет возведена в центре легендарного района — Молдаванки, на улице Болгарской, рядом с Алексеевской площадью. Колорит старинных уличек Молдаванки в сочетании с высочайшим европейским качеством строительства и обслуживания дома – это мечта многих одесситов. В этом районе есть масса преимуществ. Кроме романтической атмосферы и уютных улочек микрорайона, жильцы получат и очевидные практические преимущества – близость к центру города, авто- и железнодорожному вокзалу, рынку Привоз. В жилом комплексе будет: ухоженная придомовая территория, детская площадка собственная служба охраны и эксплуатации, места для ожидания и отдыха.'),
