(20013, 1278, 'короткое_описание', '«35 Жемчужина»  на Литературной — новый, 13-ти этажный проект компании «KADORR Group». '),
(20014, 1278, '_короткое_описание', 'field_5a78b4b9e5d81'),
(20015, 1278, 'описание', '«35 Жемчужина»  на Литературной — новый, 13-ти этажный проект компании «KADORR Group». Строительство согласно всем нормам пожарной и сейсмической безопасности, высокопрочное панорамное остекление, оснащение от ведущих производителей, просторный паркинг, собственная служба охраны и эксплуатации! Удобное сплочение со всеми районами города, развитая инфраструктура, близость к побережью Черного моря и невероятная панорама из окон!'),
