(20143, 1281, 'короткое_описание', '«23 Жемчужина» на Фонтанской дороге — малоквартирный, 5-х этажный жилой дом, который будет возведен между 9 и 10-й станциями Большого Фонтана, в экологически чистом районе города, всего в 15 минутах ходьбы от моря.'),
(20144, 1281, '_короткое_описание', 'field_5a78b4b9e5d81'),
(20145, 1281, 'описание', '«23 Жемчужина» на Фонтанской дороге — малоквартирный, 5-х этажный жилой дом, который будет возведен между 9 и 10-й станциями Большого Фонтана, в экологически чистом районе города, всего в 15 минутах ходьбы от моря. Зеленая зона для отдыха, развитая инфраструктура, высокий уровень обслуживания дома, круглосуточная охрана и видеонаблюдение, удобный паркинг, обустроенные места для семейного отдыха – все это ждет будущих жильцов. При возведении Двадцать Третяя Жемчужины, будут использованы передовые технологии, высококачественные материалы. Комплекс выделится оригинальной тонкой архитектурой, превращающей жилой дом в произведение искусства.\r\n\r\n&nbsp;'),
