(20209, 1283, 'короткое_описание', 'ЖК «Новый Люстдорф» — комплекс клубных домов расположен на Таирово (Люстдорфская дорого угол Дмитрия Донского) в районе с хорошо развитой инфраструктурой и отличной транспортной развязкой.'),
(20210, 1283, '_короткое_описание', 'field_5a78b4b9e5d81'),
(20211, 1283, 'описание', 'ЖК «Новый Люстдорф» — комплекс клубных домов расположен на Таирово (Люстдорфская дорого угол Дмитрия Донского) в районе с хорошо развитой инфраструктурой и отличной транспортной развязкой.  В ЖК «Новый Люстдорф» организовано видеонаблюдение и круглосуточная охрана территории, что дает жильцам безопасность и спокойствие. На территории размещены детская площадка, спортивная площадка, места для отдыха и прогулок. Проведено озеленение территории.\r\n\r\nПреимущества домов: Индивидуальное автономное газовое отопление.'),
