(20273, 1284, 'короткое_описание', 'ЖК «37 Жемчужина» на Архитекторской. Всего несколько лет назад компания KADORR Group начала строительство домов в этом районе. Уже сегодня здесь создан целый микрорайон со своей развитой инфраструктурой. '),
(20274, 1284, '_короткое_описание', 'field_5a78b4b9e5d81'),
(20275, 1284, 'описание', 'ЖК «37 Жемчужина» на Архитекторской. Всего несколько лет назад компания KADORR Group начала строительство домов в этом районе. Уже сегодня здесь создан целый микрорайон со своей развитой инфраструктурой. ЖК «37 Жемчужина» будет состоять из 19-ти этажей, и спроектирована с учетом последних достижений в области архитектуры. Рядом с комплексом уже работают магазины, кафетерии, детские и спортивные центры. Как и во всех комплексах от KADORR в «37 Жемчужине» будут обустроены светлые просторные парадные и коридоры, собственная служба охраны и эксплуатации, система видеонаблюдения. Это европейский подход в строительстве и обслуживании домов.'),
