(20339, 1286, 'короткое_описание', 'ЖК «41 Жемчужина» на Архитекторской. Всего несколько лет назад компания KADORR Group начала строительство домов в этом районе. Уже сегодня здесь создан целый микрорайон со своей развитой инфраструктурой.'),
(20340, 1286, '_короткое_описание', 'field_5a78b4b9e5d81'),
(20341, 1286, 'описание', 'ЖК «41 Жемчужина» на Архитекторской. Всего несколько лет назад компания KADORR Group начала строительство домов в этом районе. Уже сегодня здесь создан целый микрорайон со своей развитой инфраструктурой. ЖК «41 Жемчужина» составит архитектурный дует с жилым комплексом 40 Жемчужина. Дома «Близнецы» будет состоять из 19-ти этажных секций, и спроектированы с учетом последних достижений в области архитектуры. Во дворах расположены детские площадки, места для ожидания и отдыха. Как и во всех комплексах от KADORR в «Сорок первой Жемчужине» будут обустроены светлые просторные парадные и коридоры, собственная служба охраны и эксплуатации, система видеонаблюдения. Это европейский подход в строительстве и обслуживании домов.'),
