(20405, 1287, 'описание', 'Жилой комплекс состоит из десяти жилых домов этажностью 18-20 этажей + технический этаж и подземный паркинг.\r\n\r\nЖК «Михайловский Городок» находится на Михайловской улице, в историческом районе Молдаванка. Важным преимуществом района является его близость к центру города.\r\n\r\n«Михайловский Городок» — это 25 000 метров собственной благоустроенной территории с круглосуточной охраной и паркингом на 250 мест. Здесь все предусмотрено для комфортного отдыха будущих жителей: детские и спортивные площадки, большие зелены газоны.\r\n\r\n<strong>Квартиры в ЖК «Михайловский Городок» снабжены:</strong>\r\n<ul>\r\n 	<li>Отделка помещений не выполняется.</li>\r\n 	<li>Полы – двухслойная стяжка с нижним слоем из политермбетона с наполнителем из пенополистирольных шариков, и верхним слоем – цементной стяжки.  В санузлах стяжка и гидроизоляция не выполняется.</li>\r\n 	<li>Остекление – однокамерный стеклопакет, с энергосберегающим покрытием.</li>\r\n 	<li>Отопление – выполняется в полном объеме с установкой радиаторов.</li>\r\n 	<li>Водоснабжение –ввод холодной и горячей воды от счетчиков водоснабжения, расположенных в коридоре общего пользования.</li>\r\n 	<li>Электроснабжение – ввод электропроводки в квартиру от электронных счетчиков учета электроэнергии, расположенных в холле.</li>\r\n 	<li>Входная дверь – бронированная.</li>\r\n</ul>\r\n<strong>Территория жилого комплекса:</strong>\r\n<ul>\r\n 	<li>асфальтированные пешеходные дорожки и дороги для транспорта;</li>\r\n 	<li>озеленение придомовых территорий;</li>\r\n 	<li>подземный и гостевой паркинг;</li>\r\n 	<li>детские и спортивные площадки;</li>\r\n 	<li>охраняемая территория.</li>\r\n</ul>'),
