(20466, 1288, 'короткое_описание', 'ЖК«42 Жемчужина» на Генуэзской — новый, 24-х этажный проект компании «KADORR Group». Это курортный район Одессы, расположенный в непосредственной близости к морю, с прекрасным сообщением со всеми районами города, включая центр.'),
(20467, 1288, '_короткое_описание', 'field_5a78b4b9e5d81'),
(20468, 1288, 'описание', 'ЖК«42 Жемчужина» на Генуэзской — новый, 24-х этажный проект компании «KADORR Group». Это курортный район Одессы, расположенный в непосредственной близости к морю, с прекрасным сообщением со всеми районами города, включая центр. Комплекс будет возведен с учетом всех норм и последних достижений в области строительства и архитектуры. В ЖК«42 Жемчужина» будет паркинг, ухоженная придомовая территория, служба охраны и эксплуатации, места для семейного отдыха.'),
