(20712, 1264, '_короткое_описание', 'field_5a78b4b9e5d81'),
(20713, 1264, 'описание', 'В первой очереди строительства — 3 секции этажностью 23 этажа + технический этаж\r\n\r\n<strong>Техническое состояние квартир и офисов при передаче их владельцам*</strong>\r\n<table class="text-left">\r\n<tbody>\r\n<tr>\r\n<td></td>\r\n</tr>\r\n<tr>\r\n<td><strong>Полы</strong></td>\r\n<td>двухслойная стяжка с нижним слоем из политермбетона с наполнителем из пенополистирольных шариков, и верхним слоем – цементной стяжки. В санузлах стяжка и гидроизоляция не выполняется.</td>\r\n</tr>\r\n<tr>\r\n<td><strong>Остекление</strong></td>\r\n<td>однокамерный стеклопакет, с энергосберегающим покрытием.</td>\r\n</tr>\r\n<tr>\r\n<td><strong>Отопление</strong></td>\r\n<td>выполняется в полном объеме с установкой радиаторов.</td>\r\n</tr>\r\n<tr>\r\n<td><strong>Водоснабжение</strong></td>\r\n<td>ввод холодной и горячей воды от счетчиков водоснабжения, расположенных в коридоре общего пользования.</td>\r\n</tr>\r\n<tr>\r\n<td><strong>Канализация</strong></td>\r\n<td>ввод в квартиру от стояков.</td>\r\n</tr>\r\n<tr>\r\n<td><strong>Электроснабжение</strong></td>\r\n<td>ввод стояков холодной и горячей воды с установкой счетчиков</td>\r\n</tr>\r\n<tr>\r\n<td><strong>электроснабжение</strong></td>\r\n<td>ввод электропроводки в квартиру от электронных счетчиков учета электроэнергии, расположенных в коридоре общего пользования.</td>\r\n</tr>\r\n<tr>\r\n<td><strong>входная дверь</strong></td>\r\n<td>бронированная, внутренние двери не устанавливаются.</td>\r\n</tr>\r\n</tbody>\r\n</table>'),
