(20783, 1265, 'короткое_описание', 'ЖК «30 Жемчужина»  на Поселке Котовского — новый, 24-х этажный проект компании «KADORR Group». Дом спроектирован по последним достижениям в области строительной инженерии и архитектуры, что выгодно выделит комплекс не только внешним дизайном, но и высочайшим качеством возведения, присущим исключительно домам KADORR Group. '),
(20784, 1265, '_короткое_описание', 'field_5a78b4b9e5d81'),
(20785, 1265, 'описание', 'ЖК «30 Жемчужина»  на Поселке Котовского — новый, 24-х этажный проект компании «KADORR Group». Дом спроектирован по последним достижениям в области строительной инженерии и архитектуры, что выгодно выделит комплекс не только внешним дизайном, но и высочайшим качеством возведения, присущим исключительно домам KADORR Group. Специалистами Компании разработана система обеспечения полной безопасности и комфорта будущих жильцов дома – собственная служба охраны, круглосуточное видеонаблюдение и встроенная система пожарной безопасности.\r\n\r\nУже через два года в молодом Суворовском районе совсем рядом с «Двадцатой Жемчужиной» появится ее архитектурное продолжение «Тридцатая жемчужина» с просторной придомовой территорией, детской площадкой и собственной службой эксплуатации.'),
