(20851, 1266, 'галерея_дома', '<img class="alignnone size-full wp-image-1384" src="http://novostroy/wp-content/uploads/2018/02/1-1.jpg" alt="" width="835" height="555" /> <img class="alignnone size-full wp-image-1386" src="http://novostroy/wp-content/uploads/2018/02/sezon-all-plans-section-1-floor-2-5-524x1024.jpg" alt="" width="524" height="1024" /> <img class="alignnone size-medium wp-image-1387" src="http://novostroy/wp-content/uploads/2018/02/sezon-all-plans-section-1-floor-6-20-525x1024.jpg" alt="" width="525" height="1024" /> <img class="alignnone size-medium wp-image-1388" src="http://novostroy/wp-content/uploads/2018/02/sezon-all-plans-section-1-floor-21-24-524x1024.jpg" alt="" width="524" height="1024" /><img class="alignnone size-medium wp-image-1385" src="http://novostroy/wp-content/uploads/2018/02/2.jpg" alt="" width="835" height="555" />'),
