(20857, 1266, 'описание', 'В составе четырех жилых домов этажностью 24 этажа + технический этаж\r\n\r\n<strong>Квартиры в ЖК «4 Сезона» снабжены:</strong>\r\n<ul>\r\n 	<li>Отделка помещений не выполняется.</li>\r\n 	<li>Полы – двухслойная стяжка. Нижний слой из политермбетона с наполнителем из пенополистирольных шариков. Верхний слой – цементная стяжка.  В санузлах стяжка и гидроизоляция не выполняется.</li>\r\n 	<li>Остекление комбинированное. Панорамное в сочетании со стандартным. Стеклопакет – однокамерный, с энергосберегающим покрытием.</li>\r\n 	<li>Отопление – выполняется в полном объеме с установкой радиаторов.</li>\r\n 	<li>Водоснабжение – ввод холодной и горячей воды от счетчиков водоснабжения, расположенных в коридоре общего пользования.</li>\r\n 	<li>Электроснабжение – ввод электропроводки в квартиру от электронных счетчиков учета электроэнергии, расположенных в холле.</li>\r\n 	<li>Входная дверь – бронированная.</li>\r\n</ul>\r\n<strong>Жилые дома оборудуются средствами противопожарной защиты:</strong>\r\n<ul>\r\n 	<li>устройство эвакуационного освещения;</li>\r\n 	<li>регламентация огнестойкости конструкций;</li>\r\n 	<li>система дымоудаления.</li>\r\n</ul>\r\n<strong>Территория жилого комплекса:</strong>\r\n<ul>\r\n 	<li>асфальтированные пешеходные дорожки и дороги для транспорта;</li>\r\n 	<li>озеленение придомовых территорий;</li>\r\n 	<li>подземный и гостевой паркинг;</li>\r\n 	<li>детские и спортивные площадки;</li>\r\n 	<li>охраняемая территория.</li>\r\n</ul>'),
