(20923, 1267, 'короткое_описание', 'В составе шести жилых домов этажностью 24 этажа + технический этаж предусматривается: квартиры, апартаменты и офисы, охраняемая территория с оборудованными площадками для отдыха и занятия спортом детей и взрослых, подземный паркинг.'),
