(21019, 1270, 'короткое_описание', 'ЖК «31Жемчужина» на Фонтанской дороге – новый проект от компании KADORR Group. Современный 12-этажный жилой комплекс в непосредственной близости от моря в экологически чистом районе города между 9й и 10й станциями Б.Фонтана.'),
(21020, 1270, '_короткое_описание', 'field_5a78b4b9e5d81'),
(21021, 1270, 'описание', '<strong>ЖК «31Жемчужина»</strong> на Фонтанской дороге – новый проект от компании KADORR Group. Современный 12-этажный жилой комплекс в непосредственной близости от моря в экологически чистом районе города между 9й и 10й станциями Б.Фонтана. Проект предусматривает использование высококачественных экологически чистых материалов, а также передовых технологий строительства. Будущих жильцов ждет: зеленая зона для отдыха, развитая инфраструктура, высокий уровень обслуживания, круглосуточная охрана и видеонаблюдение, удобный паркинг.'),
