(21201, 1279, 'короткое_описание', 'Жилой комплекс «CityPark» – это комплекс из 4 жилых 9-16-этажных домов повышенной комфортности, расположенных по улице Пестеля в уникальной ландшафтно-парковой зоне.'),
(21202, 1279, '_короткое_описание', 'field_5a78b4b9e5d81'),
(21203, 1279, 'описание', '<strong>Жилой комплекс «CityPark» </strong>– это комплекс из 4 жилых 9-16-этажных домов повышенной комфортности, расположенных по улице Пестеля в уникальной ландшафтно-парковой зоне.\r\n\r\n<strong>Характеристики объекта:</strong>\r\n<ul>\r\n 	<li>Берлинский принцип соотношения зеленой зоны и застройки (деревьев и цветников как минимум столько же и больше по площади, что и жилых объектов).</li>\r\n 	<li>Передовые западные и отечественные энергосберегающие технологии.</li>\r\n 	<li>Экологичность стройматериалов.</li>\r\n 	<li>Квартиры с выверенной площадью и оптимальной планировкой.</li>\r\n 	<li>Автономное жизнеобеспечение с собственной инфраструктурой.</li>\r\n 	<li>Комплексный проект застройки.</li>\r\n</ul>'),
