(21437, 1285, 'короткое_описание', '«24 Жемчужина» на пересечении Французского и Итальянского бульваров. – 13-ти этажный дом. Комплекс будет возведен с учетом последних достижений в области строительства и архитектуры. '),
(21438, 1285, '_короткое_описание', 'field_5a78b4b9e5d81'),
(21439, 1285, 'описание', '«24 Жемчужина» на пересечении Французского и Итальянского бульваров. – 13-ти этажный дом. Комплекс будет возведен с учетом последних достижений в области строительства и архитектуры. Достоинства будущего дома оценят все без исключения. В жилом комплексе 24  Жемчужина будет паркинг, ухоженная придомовая территория, служба охраны и эксплуатации, места для ожидания и отдых. Двадцать Четвертая Жемчужина находится в пешей близости от пляжей Отрада и Ланжерон, а также знаменитая Канатная дорога.'),
