(21537, 1543, 'короткое_описание', 'ЖК «10 жемчужина» располагается на улице Марсельской. Находящаяся недалеко «Четвертая жемчужина» создает неповторимый гармоничный дует, и облагораживают нетривиальной архитектурой весь Суворовский район.'),
