(21705, 1552, 'короткое_описание', '«1 Жемчужина» - это первое жемчужное детище KADORR Group в Одессе. Этот легендарный комплекс был сдан в эксплуатацию всего за семнадцать месяцев, его возведение не прерывалось не на один день. Уникальный, качественный, надежный объект соблюденный по всем техническим характеристикам.'),
(21706, 1552, '_короткое_описание', 'field_5a78b4b9e5d81'),
(21707, 1552, 'описание', '«1 Жемчужина» - это первое жемчужное детище KADORR Group в Одессе. Этот легендарный комплекс был сдан в эксплуатацию всего за семнадцать месяцев, его возведение не прерывалось не на один день. Уникальный, качественный, надежный объект соблюденный по всем техническим характеристикам. Профессионализм, верность своему делу, ответственность сделало строительную компанию KADORR Group, лидирующим. KADORR Group смело взял на себя ответственность за европейское качество домов и гарантировал сроки сдачи.'),
