(21951, 1579, 'короткое_описание', 'В элитном районе Южной Пальмиры можно лицезреть прекрасную жемчужину современной архитектуры. Здесь восходит «Вторая Жемчужина» от KADORR Group. Природная красота и развитая инфраструктура удачно сочетается в этом милом уголке Одессы. '),
(21952, 1579, '_короткое_описание', 'field_5a78b4b9e5d81'),
(21953, 1579, 'описание', 'В элитном районе Южной Пальмиры можно лицезреть прекрасную жемчужину современной архитектуры. Здесь восходит «Вторая Жемчужина» от KADORR Group. Природная красота и развитая инфраструктура удачно сочетается в этом милом уголке Одессы. Благоустроены пляжи, многочисленны красивые ухоженные зоны для отдыха. Хорошая транспортная развязка и большое количество социальных объектов, так необходимых в повседневной жизни. KADORR Group строит с большим качеством, а думает о людях с душевной теплотой!'),
