(22250, 1616, 'дом_на_карте', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2748.861245770229!2d30.759647051225727!3d46.451446274943514!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x40c633e0f8909117%3A0x37c88879d169434b!2z0KTRgNCw0L3RhtGD0LfRgdC60LjQuSDQsdGD0LsuLCDQntC00LXRgdGB0LAsINCe0LTQtdGB0YHQutCw0Y8g0L7QsdC70LDRgdGC0Yw!5e0!3m2!1sru!2sua!4v1509821481057" width="600" height="450" frameborder="0" style="border:0" allowfullscreen=""></iframe>'),
(22251, 1616, '_дом_на_карте', 'field_5a8dd29437cba'),
(22252, 1616, 'короткое_описание', '«3 Жемчужина» - этот удивительный жилой комплекс стал родоначальником развития нового современного микрорайона города Одессы. Здесь постоянно развивается инфраструктура, работают многочисленные магазины, кафе и развлекательные центры. '),
(22253, 1616, '_короткое_описание', 'field_5a78b4b9e5d81'),
(22254, 1616, 'описание', '«3 Жемчужина» - этот удивительный жилой комплекс стал родоначальником развития нового современного микрорайона города Одессы. Здесь постоянно развивается инфраструктура, работают многочисленные магазины, кафе и развлекательные центры. Для детишек работают детские центры, на территории построены детские площадки, а для молодежи работают спортивные клубы. KADORR Group позаботился о доступности цен, комфортности условий, что позволило одесситам приобрести и насладится высочайшего уровня жизнью.'),
