(22545, 1637, 'дом_на_карте', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2747.7897516815806!2d30.737044151226296!3d46.47267237350358!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x40c63182e89f1339%3A0x52a5175530c1ef29!2z0YPQuy4g0JHQvtC70YzRiNCw0Y8g0JDRgNC90LDRg9GC0YHQutCw0Y8sINCe0LTQtdGB0YHQsCwg0J7QtNC10YHRgdC60LDRjyDQvtCx0LvQsNGB0YLRjA!5e0!3m2!1sru!2sua!4v1509821471484" width="600" height="450" frameborder="0" style="border:0" allowfullscreen=""></iframe>'),
