(22547, 1637, 'короткое_описание', '«4 жемчужина» от ведущей компании KADORR Group размещена на улице Марсельской. Находится она в Суворовском районе – это очень молодой, но перспективный уголок города Одессы. '),
(22548, 1637, '_короткое_описание', 'field_5a78b4b9e5d81'),
(22549, 1637, 'описание', '<div class="agile_author">\r\n<div class="agile_author_grid p_d">\r\n\r\n«4 жемчужина» от ведущей компании KADORR Group размещена на улице Марсельской. Находится она в Суворовском районе – это очень молодой, но перспективный уголок города Одессы. Новые коммуникации и развитая инфраструктура, являются несомненно его преимуществом. KADORR Group подарил жителям этого комплекса прекрасный панорамный вид на залив, комфортабельный подход к морю. Доступность к общественному транспорту, а также высочайший уровень обслуживания.\r\n\r\n</div>\r\n</div>\r\n<div class="agileits_comment sing-side-form"></div>'),
