(22779, 1654, 'дом_на_карте', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2749.2245355341583!2d30.70953495122555!3d46.44424787543161!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x40c633b36a8895e3%3A0x49b8eaae1a695654!2z0YPQuy4g0JzQsNGA0YjQsNC70LAg0JzQsNC70LjQvdC-0LLRgdC60L7Qs9C-LCDQntC00LXRgdGB0LAsINCe0LTQtdGB0YHQutCw0Y8g0L7QsdC70LDRgdGC0Yw!5e0!3m2!1sru!2sua!4v1509821450480" width="600" height="450" frameborder="0" style="border:0" allowfullscreen=""></iframe>'),
(22780, 1654, '_дом_на_карте', 'field_5a8dd29437cba'),
(22781, 1654, 'короткое_описание', 'СК KADORR Group создал небесной красоты комплекс «Пятая Жемчужина». Амбициозность и грация архитектуры - это основные внешние черты комплекса. Это масштабный проект, который насчитывает в себе девять секций состоящих из 18 этажей каждая. '),
(22782, 1654, '_короткое_описание', 'field_5a78b4b9e5d81'),
(22783, 1654, 'описание', '<div class="agile_author">\r\n<div class="agile_author_grid p_d">\r\n\r\nСК KADORR Group создал небесной красоты комплекс «Пятая Жемчужина». Амбициозность и грация архитектуры - это основные внешние черты комплекса. Это масштабный проект, который насчитывает в себе девять секций состоящих из 18 этажей каждая. На его обширной придомовой территории располагается все, что необходимо для комфортной жизни. Благоустроен красивейший сквер и фонтан, территория обогащена плодовыми и хвойными деревьями, дети очень любят резвится на новейших современных детских площадках.\r\n\r\n</div>\r\n</div>\r\n<div class="agileits_comment sing-side-form"></div>'),
