(23255, 1688, 'короткое_описание', '«6 Жемчужина» новый дом, который расположился на Гагаринском плато. Самый респектабельный район города Одессы Аркадия очень подходит для такого великолепного комплекса. Не сколько минут до моря и вы можете довольствоваться прекрасными прогулками вдоль морского побережья, дышать свежим соленым воздухом, греться на теплом солнце Одессы. '),
(23256, 1688, '_короткое_описание', 'field_5a78b4b9e5d81'),
(23257, 1688, 'описание', '<div class="agile_author">\r\n<div class="agile_author_grid p_d">\r\n\r\n«6 Жемчужина» новый дом, который расположился на Гагаринском плато. Самый респектабельный район города Одессы Аркадия очень подходит для такого великолепного комплекса. Не сколько минут до моря и вы можете довольствоваться прекрасными прогулками вдоль морского побережья, дышать свежим соленым воздухом, греться на теплом солнце Одессы. Шикарно обустроена придомовая территория, здесь каждый ребенок найдет себе занятие по душе для предусмотрены современные детские площадки, взрослые смогут отдохнуть в тени многочисленной зелени. Стоит отметить ухоженную территорию и парадные. Круглосуточное видеонаблюдение и охрана делают жизнь спокойной и чувствуется надежность в каждом дне.\r\n\r\n</div>\r\n</div>\r\n<div class="agileits_comment sing-side-form"></div>'),
