(24078, 1753, 'короткое_описание', '«8 Жемчужина» находится на Французском бульваре в г. Одессе. Этот комплекс расположен в красивейшем живописном месте, которое с давних времен воспевалось поэтами и писателями. '),
(24079, 1753, '_короткое_описание', 'field_5a78b4b9e5d81'),
(24080, 1753, 'описание', '<div class="agile_author">\r\n<div class="agile_author_grid p_d">\r\n\r\n«8 Жемчужина» находится на Французском бульваре в г. Одессе. Этот комплекс расположен в красивейшем живописном месте, которое с давних времен воспевалось поэтами и писателями. Прекрасные панорамные виды на морской залив. Современная и развитая инфраструктура района. Близость к Аркадии и легендарным пляжам Одессы. Этот комплекс для людей нового поколения, для людей любящих комфорт и безопасность.\r\n\r\n</div>\r\n</div>\r\n<div class="agileits_comment sing-side-form"></div>'),
