(25171, 1819, 'короткое_описание', '«11 Жемчужина» - это комплекс, который был возведен в г. Одесса на улице Маршала Малиновского в 2015 году. '),
(25172, 1819, '_короткое_описание', 'field_5a78b4b9e5d81'),
(25173, 1819, 'описание', '<div class="agile_author">\r\n<div class="agile_author_grid p_d">\r\n\r\n«11 Жемчужина» - это комплекс, который был возведен в г. Одесса на улице Маршала Малиновского в 2015 году. Этот жилой объект был сдан в срок, чем в очередной раз подтвердил персональные гарантии Аднана Кивана. Красивейший комплекс был построен по стандартом Европы. Материалы, которые использовались в строительстве этого жилого комплекса самые качественные и проверенные годами на мировом рынке. Там можно не просто жить, а получать удовольствие от каждой минуты комфорта.\r\n\r\n</div>\r\n</div>\r\n<div class="agileits_comment sing-side-form"></div>'),
