(25225, 1821, 'короткое_описание', '«12 Жемчужина» от легендарной строительной компании в Европе KADORR Group, размещается в перспективном и все время развивающемся районе города Одессы. '),
(25226, 1821, '_короткое_описание', 'field_5a78b4b9e5d81'),
(25227, 1821, 'описание', '<div class="agile_author">\r\n<div class="agile_author_grid p_d">\r\n\r\n«12 Жемчужина» от легендарной строительной компании в Европе KADORR Group, размещается в перспективном и все время развивающемся районе города Одессы. Находится этот комплекс на улице Малиновского. Развитая и усовершенствованная инфраструктура района, хорошая транспортная развязка, которая позволит добраться в самые отдаленные места города Одессы. Здесь созданы все условия для комфортной и счастливой жизни. Качественные материалы от ведущих производителей Европы, соблюдение всех стандартов в строительстве является главной и традиционной чертой KADORR Group.\r\n\r\n</div>\r\n</div>\r\n<div class="agileits_comment sing-side-form"></div>'),
