(25357, 1827, 'дом_на_карте', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2748.861245770229!2d30.759647051225727!3d46.451446274943514!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x40c633e0f8909117%3A0x37c88879d169434b!2z0KTRgNCw0L3RhtGD0LfRgdC60LjQuSDQsdGD0LsuLCDQntC00LXRgdGB0LAsINCe0LTQtdGB0YHQutCw0Y8g0L7QsdC70LDRgdGC0Yw!5e0!3m2!1sru!2sua!4v1509821396488" width="600" height="450" frameborder="0" style="border:0" allowfullscreen=""></iframe>'),
(25358, 1827, '_дом_на_карте', 'field_5a8dd29437cba'),
(25359, 1827, 'короткое_описание', 'Прекрасная «15 Жемчужина» от СК KADORR Group блещет и украшает собой и без того изумительный район Таирова. Изюминкой этого комплекса, является уникальный, зимний сад расположенный в холе дома. '),
(25360, 1827, '_короткое_описание', 'field_5a78b4b9e5d81'),
(25361, 1827, 'описание', '<div class="agile_author">\r\n<div class="agile_author_grid p_d">\r\n<div class="agile_author">\r\n<div class="agile_author_grid p_d">\r\n\r\nПрекрасная «15 Жемчужина» от СК KADORR Group блещет и украшает собой и без того изумительный район Таирова. Изюминкой этого комплекса, является уникальный, зимний сад расположенный в холе дома. Живя здесь получаешь комфорт мегаполиса и гармоничную размеренность духа. Красивейшие виды на город, развитая инфраструктура, многочисленные места для отдыха и все, что необходимо для комфортной жизни.\r\n\r\n</div>\r\n</div>\r\n<div class="agileits_comment sing-side-form"></div>\r\n</div>\r\n</div>'),
