(25426, 1829, '_дом_на_карте', 'field_5a8dd29437cba'),
(25427, 1829, 'короткое_описание', 'Прекрасная «15 Жемчужина» от СК KADORR Group блещет и украшает собой и без того изумительный район Таирова. Изюминкой этого комплекса, является уникальный, зимний сад расположенный в холе дома. '),
(25428, 1829, '_короткое_описание', 'field_5a78b4b9e5d81'),
(25429, 1829, 'описание', '<div class="agile_author">\r\n<div class="agile_author_grid p_d">\r\n<div class="agile_author">\r\n<div class="agile_author_grid p_d">\r\n\r\nПрекрасная «15 Жемчужина» от СК KADORR Group блещет и украшает собой и без того изумительный район Таирова. Изюминкой этого комплекса, является уникальный, зимний сад расположенный в холе дома. Живя здесь получаешь комфорт мегаполиса и гармоничную размеренность духа. Красивейшие виды на город, развитая инфраструктура, многочисленные места для отдыха и все, что необходимо для комфортной жизни.\r\n\r\n</div>\r\n</div>\r\n<div class="agileits_comment sing-side-form"></div>\r\n</div>\r\n</div>'),
