(25492, 1830, '_дом_на_карте', 'field_5a8dd29437cba'),
(25493, 1830, 'короткое_описание', '«17 Жемчужина» от компании KADORR Group, является хорошим примером где сочетаются новейшие технологии современного строительства и архитектура исторической Одессы. '),
(25494, 1830, '_короткое_описание', 'field_5a78b4b9e5d81'),
(25495, 1830, 'описание', '<div class="agile_author">\r\n<div class="agile_author_grid p_d">\r\n<div class="agile_author">\r\n<div class="agile_author_grid p_d">\r\n<div class="agile_author">\r\n<div class="agile_author_grid p_d">\r\n\r\n«17 Жемчужина» от компании KADORR Group, является хорошим примером где сочетаются новейшие технологии современного строительства и архитектура исторической Одессы. Находится жилой комплекс на улице Асташкина. Красивейший фасад здания, искусный дизайн и элегантность архитектуры замечательно вливается в историю Одессы. Строительство «17 Жемчужины» стало толчком для развития района и вдохновило город на лучшие перемены.\r\n\r\n</div>\r\n</div>\r\n<div class="agileits_comment sing-side-form"></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>'),
